import axios from "axios";

function Projects() {
    const [allProjects,setAllProjects] = useState([])
  useEffect(() => {
     fetchData=async()=>{
   try {
      const res = await axios.get("http://localhost:5000/dashboard/projects");
      console.log("all projects", res.data);
      setAllProjects(res.data)
    } catch (errr) {
      console.log(errr);
    }
    }
 
  },[]);
 
  return <div>
    {allProjects.map((ele,i)=>(<div key={i}>{ele.name} <img src={ele.image} alt="projects" /></div>))}
  </div>;
}

export default Projects;
